min_temp: 0
max_temp: 110

[virtual_sdcard] 
path:/home/sovol/printer_data/gcodes/

[pause_resume]

[printer]
kinematics: corexy           
max_velocity: 700            
max_accel: 40000             
#max_accel_to_decel: 10000     
max_z_velocity: 30           
max_z_accel: 500
square_corner_velocity: 5.0  

[input_shaper]
damping_ratio_x: 0.001
damping_ratio_y: 0.001
shaper_type_x = mzv
shaper_freq_x = 65.2
shaper_type_y = mzv
shaper_freq_y = 40.4

[bed_mesh]
speed: 500                   
horizontal_move_z: 2         
mesh_min: 10, 10              
mesh_max: 345, 345            
probe_count: 9,9             
algorithm: bicubic   
bicubic_tension: 0.4
zero_reference_position: 177.5, 177.5
split_delta_z: 0.0125 #0.016
mesh_pps:3, 3
adaptive_margin: 5
fade_start: 0
fade_end: 10
fade_target: 0

[quad_gantry_level]          
gantry_corners:              
    -60,-30
    420,470
points:
    25,40
    25,320
    330,330
    330,40
speed: 500                   
horizontal_move_z: 5       
retry_tolerance: 0.010 #0.05     
retries: 5                  
max_adjust: 10 #30              

[stepper_x]
step_pin: PE2
dir_pin: !PE0
enable_pin: !PE3
rotation_distance: 40         
microsteps: 64 #16                
full_steps_per_rotation:200   
endstop_pin: tmc2209_stepper_x: virtual_endstop              
position_min: 0               
position_endstop: 0         
position_max: 358             
homing_speed: 30              
homing_retract_dist: 0
homing_positive_dir: False     
